import React from 'react'

function Posts({posts}) {
  return (
    <div className='w-100 gap-2'>
        {posts.map(post=>{
            return(
                <div className='w-100 d-flex border p-1'>
                    {post.Title}
                </div>
            )
        })}
    </div>
  )
}

export default Posts
